import React from 'react';
import Thumbnail from './Thumbnail.js'; 
import './App.css';
class Projects extends React.Component {
  render(){
  return (
    
    <div className="Projects">
        <Thumbnail
        link="./CommuteForecast"
        image= 'src\CommuteForecast\CommuteForecast.GIF'
        title="Commute Forecast"
        category="Web App"
        />
 
        <Thumbnail
        link="/DentalDeserts"
        image="./DentalDeserts/DentalDeserts.gif"
        title="Dental Deserts in US"
        category="Web App"
        />
 
        <Thumbnail
        link="/NHLAttendance"
        image="./NHLAttendance/NHLAttendance.GIF"
        title="NHL Season Attendance"s
        category="Web App"
        />
    </div>
  )
}
}
 
export default Projects;
